import React from 'react';

class Counter extends React.Component{
    state = {
        count: 0
    }
    render(){
        return(
            <div>
             <span>{this.state.count}</span>
             <button onClick={this.inc()}>Increment</button>
            </div>

        );
    }
    inc(){
        this.state.count += 1
    }
}

export default Counter;
